function getColor(CONSTITUEN){
    if (CONSTITUEN == "KAJIADO SOUTH"){
    return "red";
    }else{
    return 'BROWN'}
}

function style(feature) {
    return {
        fillColor: getColor(feature.properties.CONSTITUEN),
        weight: 2,
        opacity: 1,
        color: 'white',
        dashArray: '3',
        fillOpacity: 0.7
    };
}




var info = L.control();

info.onAdd = function (map) {
    this._div = L.DomUtil.create('div', 'info'); // create a div with a class "info"
    this.update();
    return this._div;
};

// method that we will use to update the control based on feature properties passed
info.update = function (props) {
    this._div.innerHTML = '<h4>Kajiado County</h4>' +  (props ?
        '<b>' + props.AREA2 + '</b><br />' + props.AREA2 + ' males / mi<sup>2</sup>'
        : 'This is Kajiado County');
};

info.addTo(map);


